import React, { Component } from 'react';
import './navBar.css';

class NavBar extends Component {
    render() {
        return (
            <div className="navBar">
                <div className="navBarContent">
                    <div className="elements">
                        Scan Cube
                    </div>
                    <div className="elements">
                        Go Virtual
                    </div>
                </div>
            </div>
        )
    }
}

export default NavBar;
